import React, { Component } from 'react';
import './css/Home.css'
import { Grid, Card, Paper} from '@material-ui/core';
import RegionesChile from '../components/ContainerHome'

const cardStyle = {
    height: '800px',
    widht:'700px'
};

export default class Home extends Component {
    render() {
        return (
            <>  
                <Grid container>
                    <Card className='main1'>
                        <Paper className='paper_sec' style={cardStyle}>
                            <h1>Propiedades por Regiones</h1>
                            <RegionesChile/>
                        </Paper>
                    </Card>
                    <Card className='main2'>
                        <Paper className='paper_sec' style={cardStyle}>
                            Hola
                        </Paper>
                    </Card>
                   </Grid>
                
            </>
        )
    }
}
